import React from 'react'
import { View, Image, StyleSheet } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import FoodPublishScreen from '../FoodPublish';

const Tab = createBottomTabNavigator();

const bottomNavBar = () => {
  return (
      <Tab.Navigator
      screenOptions={{
        headerShown: false,
    }}
    >
        <Tab.Screen name="Obroki zate" component={FoodPublishScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:20}}
                    source={require('../../Icons/hrana.png')}
                    />
              );
                }
            }} />
        <Tab.Screen name="Obroki za Å¾ivino" component={FoodPublishScreen} options={{
              tabBarIcon: (tabInfo) => {
                return (
                    <Image
                    style={{height:20,width:20}}
                    source={require('../../Icons/pujs.png')}
                    />
              );
                }
            }} />
        <Tab.Screen name="Zemljevid eko dejavnosti" component={FoodPublishScreen} options={{
            tabBarIcon: (tabInfo) => {
            return (
                <Image
                style={{height:20,width:20}}
                source={require('../../Icons/maps.png')}
                />
            );
            }
        }}/>
      </Tab.Navigator>
  );
  
}
export default bottomNavBar;
